INSERT INTO `infoconvenios` (`id`, `nome`, `cnpj`, `foto`, `altImagem`, `textoDescricao`, `endereco`, `cidade`, `telefone`, `metaDescription`) VALUES
(1, 'Caring Saúde', '', 'assets/img/credenciados/caring-saude.png', 'foto Caring Saúde', 'Serviços de assessoria, consultoria, orientação e assistência operacional para a gestão do negócio prestados a empresas e a outras organizações, em matéria de planejamento, organização, reengenharia, controle orçamentário, informação, gestão, etc.\r\n				Definição de métodos e procedimentos de contabilidade geral, de contabilidade de custos, de controle de orçamentos.\r\n				Consultoria para a negociação entre empresas e seus trabalhadores.\r\n				Consultoria em relações públicas e comunicação, interna e externa.\r\n				Consultoria em logística de localização.', 'Ana Guedes Vasconcelos, 81 - Altiplano Cabo Branco', 'João Pessoa - PB', '(83) 98113-1919', 'Serviços de assessoria, consultoria, orientação e assistência operacional para a gestão do negócio'),
(2, 'Unimed', '000.000.02', 'assets/img/credenciados/unimed.jpg', 'foto Unimed', 'O Hospital Alberto Urquiza Wanderley é referência em procedimentos de alta complexidade na rede da Unimed João Pessoa, destacando-se pela qualidade dos serviços oferecidos e pelo pioneirismo. Desde a sua inauguração em 7 de abril de 1999, a unidade tem possibilitado a realização de procedimentos inéditos na Paraíba, contribuindo para engrandecer a história da medicina no Estado.<br>Também tem se destacado pela conquista de certificações nacionais e internacionais, o que atesta a qualidade nos serviços e processos. Toda essas conquistas são consequência do trabalho diário desenvolvido. A instituição tem protocolos, fluxos e normas que disciplinam o atendimento, garantindo a qualidade no atendimento e o bem-estar dos pacientes. Além disso, os treinamentos, em todas as áreas, são constantes para o aprimoramento das equipes.', 'Av Ministro José Américo de Almeida, 1450, Torre', 'João Pessoa - PB', '(83) 2106-0216*', 'O Hospital Alberto Urquiza Wanderley é referência em procedimentos de alta complexidade na rede da Unimed João Pessoa.'),
(3, 'Smile Saúde', '', 'assets/img/credenciados/smile-saude.jpg', 'foto Smile Saúde', 'A Smile Saúde comercializa três tipos Planos de Saúde:<ul><li><strong>ESSENCIAL:</strong> O melhor custo-benefício do mercado. Possui atendimento dedicado através da Unidade de Atendimento Essencial – um espaço exclusivo com equipe multifuncional especializada, estrutura clínica ambulatorial moderna e rede de atendimento direcionada. Um plano feito sob medida para quem quer cuidar da saúde com economia, segurança e tranquilidade.</li><li><strong>PREMIUM:</strong> Ideal para quem quer liberdade na hora de decidir como manter a saúde em dia. Possui ampla rede credenciada com os melhores profissionais, clínicas, laboratórios e hospitais da região. Um plano com soluções perfeitas para você, sua família e colaboradores.</li><li><strong>PLATINUM:</strong> A maior rede credenciada com referência em atendimento na região e suporte nacional (Urgência e Emergência). Um time completo de especialistas e prestadores disponíveis para quem busca segurança, comodidade e qualidade de vida sem abrir mão do padrão Smile no cuidado com a saúde e bem-estar.</li>		</ul>', 'Av Maximiano Figueiredo, 207 - Centro', 'João Pessoa - PB', '(83) 4007-2057', 'A Smile Saúde comercializa três tipos Planos de Saúde: o Essencial, Premium e Platinum'),
(4, 'Univida', '', 'assets/img/credenciados/univida.jpg', 'foto Univida', 'Sua saúde agora tem lugar certo: Policlínica UNIVIDA! Qualidade e profissionalismo a serviço da vida!', 'R. Melvin Jones, 109 - Bairro dos Ipês', 'João Pessoa - PB', '(83) 98123-0540', 'Sua saúde agora tem lugar certo: Policlínica UNIVIDA! Qualidade e profissionalismo a serviço da vida!'),
(6, 'Porto Restaurante', '', 'assets/img/credenciados/porto-restaurante.jpg', 'foto Porto Restaurante', 'Conhecido como um dos restaurantes mais requisitados de João Pessoa, o Porto Restaurante oferece um conceito de gastronomia diferenciada.', 'Rua Antônio Carlos Araújo, 60, Cabo Branco', 'João Pessoa - PB', '(83) 3247-1594', 'Conhecido como um dos restaurantes mais requisitados de João Pessoa, o Porto Restaurante oferece um conceito de gastronomia diferenciada.'),
(7, 'Churrascaria Tchê', '', 'assets/img/credenciados/churrascaria-do-tche.jpg', 'foto Churrascaria Tchê', 'Serviços: churrasco estilo rodízio para eventos, confraternizações, aniversários, com estrutura e equipe treinada - cortes nobres e serviço completo.', 'Rua Nanci Clarice Tomazoni, 585, Ponta de Campiba', 'Cabedelo - PB', '(83) 98886-0706', 'Serviços: churrasco estilo rodízio para eventos, confraternizações, aniversários, com estrutura e equipe treinada - cortes nobres e serviço completo.'),
(8, 'Classic Restaurante', '', 'assets/img/credenciados/classic-restaurant.jpg', 'foto Classic Restaurante', 'Possuímos estacionamento exclusivo.', 'Avenida Dr, R. João Bernardo de Albuquerque, 125 - Torre', 'João Pessoa - PB', '(83) 3221-3975', 'Possuímos estacionamento exclusivo.'),
(11, 'Hardman Praia', '', 'assets/img/credenciados/hardman-praia.jpg', 'foto Hardman Praia', 'Em frente à Praia de Manaíra, este hotel com vista para o mar fica a 9 minutos a pé da Praça Alcides Carneiro e a 19 km do Aeroporto Internacional de João Pessoa-Bayeux. Os quartos modernos e casuais dispõem de Wi-Fi gratuito, TV com tela plana e frigobar, além de cofre e escrivaninha. Os quartos de categoria mais alta têm varanda e sala de estar. A maioria tem vista para a praia. As suítes têm varanda, algumas com vista para o mar. Serviço de quarto disponível. O café da manhã e o estacionamento são gratuitos. Há também um restaurante e um bar ao lado da piscina com vista para a praia, além de uma sala de jogos e uma sala de ginástica.', 'Av. João Maurício, 1341 - Manaíra', 'João Pessoa - PB', '(83) 3216-8811', 'Em frente à Praia de Manaíra, este hotel com vista para o mar fica a 9 minutos a pé da Praça Alcides Carneiro e a 19 km do Aeroporto Internacional de João Pessoa-Bayeux.'),
(12, 'Hotel Netuanah', '', 'assets/img/credenciados/hotel-netuanah.png', 'foto Hotel Netuanah', 'Com privilegiada localização na Praia do Cabo Branco, ponto extremo oriental da América Latina, o Netuanah Praia Hotel oferece apartamentos confortáveis e equipados com excelente vista para a praia do Cabo Branco.', 'Av. Cabo Branco, 2698 - Cabo Branco', 'João Pessoa - PB', '(83) 3247-5050', 'Com privilegiada localização na Praia do Cabo Branco, ponto extremo oriental da América Latina, o Netuanah Praia Hotel oferece apartamentos confortáveis e equipados com excelente vista para a praia do Cabo Branco.'),
(13, 'Camaratuba Hotel Fazenda', '', 'assets/img/credenciados/camaratuba-hotel-fazenda.jpg', 'foto Camaratuba Hotel Fazenda', 'O Camaratuba Hotel Fazenda possui uma grande estrutura com várias opções de lazer, em meio à exuberante natureza que brota nos arredores.<ul><li>Play ground</li><li>Pedalinho no em nosso lago</li><li>Barco a remo</li><li>Caiaque</li><li>Salão de jogos</li><li>Sala para karaokê</li><li>Churrasqueira</li><li>Passeio Cavalo e charrete</li><li>Caminhadas ecológicas</li></ul>Temos um amplo e arejado restaurante, com rústica decoração adaptada ao ambiente natural do Hotel e com cardápio baseado na deliciosa culinária local preparada por profissionais formados na terra, em fogão a lenha de aproveitamento de podas que fazemos anualmente em nosso pomar e outras arvores. Descontos de 13% para os sócios e dependentes.', 'Lote rural 280 - s/n', 'Mamanguape - PB', '(83) 98777-5349', 'O Camaratuba Hotel Fazenda possui uma grande estrutura com várias opções de lazer, em meio à exuberante natureza que brota nos arredores.'),
(14, 'Hotel Slaviero Essential João Pessoa', '', 'assets/img/credenciados/slaviero.png', 'foto slaviero', 'Valores das diariais para sócio -  Duplo - 200,00 - casal + criança até 8 anos   -   Triplo - 250,00    -   Quadruplo - 250,00 + 50,00 por pessoa . Para reservas ligue 99137-1324 ( falar com Kilma', ' Av. Cabo Branco, 2870 - Cabo Branco', 'João Pessoa', '(83) 99137-1324', 'Valores das diariais para sócio -  Duplo - 200,00 - casal + criança até 8 anos'),
(16, 'Influx', '', 'assets/img/credenciados/influx.jpg', 'foto Influx', 'inFlux Escola de Idiomas.', 'Av. Guarabira, nº 626 - Manaíra', 'João Pessoa - PB', '(83) 3035-3822', 'inFlux Escola de Idiomas.'),
(17, 'Kumon', '', 'assets/img/credenciados/kumon.jpg', 'foto Kumon', 'Kumon é um método que visa desenvolver o autodidatismo nos alunos de forma individualizada por intermédio das disciplinas de matemática e língua pátria.', 'R. Bancário Sérgio Guerra, 900 - SALAS 216/217 - Anatólia', 'João Pessoa - PB', '(83) 3043-0443', 'Kumon é um método que visa desenvolver o autodidatismo nos alunos de forma individualizada por intermédio das disciplinas de matemática e língua pátria.'),
(22, 'Ophtalmica', '', 'assets/img/credenciados/ophtamilca.jpg', 'foto Ophtalmica', 'A Nossa Missão é a saúde da sua Visão, profissionais ópticos técnicos altamente qualificados, com foco na saúde ocular, entendemos que somos um complemento aos atendimentos médicos Oftalmológicos.', 'Av Epitácio Pessoa 1251 loja 01, Empresarial Epitácio Pessoa - Bairro dos Estados', 'João Pessoa - PB', '(83) 3221-5252', 'A Nossa Missão é a saúde da sua Visão, profissionais ópticos técnicos altamente qualificados, com foco na saúde ocular.'),
(23, 'Sonhare Prime Colchões', '', 'assets/img/credenciados/sonhar-colchoes.jpg', 'foto Sonhare Prime Colchões', 'Descontos de para os pagamentos em todos os cartões em até 10 vezes sem juros.', 'Av. Epitácio Pessoa, 2668', 'João Pessoa - PB', '(83) 3566-2899', 'Descontos de para os pagamentos em todos os cartões em até 10 vezes sem juros.'),
(27, 'Brazil Autoseg', '', 'assets/img/credenciados/brazil-autoseg.jpg', 'foto Brazil Autoseg', 'Somos a Brazil Autoseg. Oferecemos serviços especializados na área de segurança automotiva com rastreador para todo o Brasil.', 'ua Duarte da Silveira, 869 , Centro', 'João Pessoa - PB', '(83) 98621-2121', 'Somos a Brazil Autoseg. Oferecemos serviços especializados na área de segurança automotiva com rastreador para todo o Brasil.');
